import { Container } from '@cloudscape-design/components';
import '@cloudscape-design/global-styles/index.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <Container>
        <Button variant="primary">Welcome to THE TEK SHOW</Button>
      </Container>
    </div>
  );
}

export default App;
